import React from 'react';
import logo from './footwear-312182_960_720.png';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a href="https://shoesoneuf972.com"><img src={logo} className="App-logo" alt="logo" /></a>
        <br/>
        <Footer />
      </header>
    </div>
  );
}

export default App;
